import React,{Component, Fragment} from 'react';
import { Container } from 'react-bootstrap';
import Navberr from "../component/nav_component/Nav";
class ContactPage extends Component{  
    render(){
        return (
        <Fragment>
            <Container>
                <Navberr />
                <h3>Contact page</h3>
            </Container>
        </Fragment>
        )
    }
}
export default ContactPage;
